import React, { useState } from "react"
import MapPoint from "./MapPoint";

export default function Map() {
  let listPoints = [];

  for (let i=0; i<10; i++) {
    listPoints.push(<MapPoint label={i.toString()}/>);
  }

  return (
    <React.Fragment>
      {listPoints}
      <img src="/pokearth/hoenn.png" useMap="#hoenn" width="306" height="221" border="0" />
      <map name="hoenn">
      <area href="/pokearth/hoenn/route134.shtml" shape="rect" coords="100, 147, 131, 155" title="Route 134"></area>
      </map>
    </React.Fragment>
  );
}
